import React from 'react';

const ChooseServices = () => {
  return (
    <>
       <section className='Choose_section'>
        <div className='container'>
            <div className='row'>
                <div className='col-lg-6 col-md-6 col-12'>
                    <div className='C_content'>
                        <h1>Why you should choose our services</h1>
                        <p>Anim pariatur cliche reprehenderit, enim eiusmod high life accusamus terry richardson ad squid. 3 wolf moon officia aute, non cupidatat skateboard dolor brunch Food truck</p>
                    </div>
                </div>
            </div>
        </div>
       </section>
    </>
  )
};

export default ChooseServices;
